import React, { FunctionComponent } from 'react';
import Parallax from '../Parallax/Parallax';

const About: FunctionComponent = () => {
    return (
        <Parallax img="images/parallax-2.jpg" speed={0.5}>
            
        </Parallax>
    )
}

export default About;
